import {BrowserRouter,Routes ,Route} from 'react-router-dom';

import Login from './Pantallas/Login';
import  MenuP  from './Pantallas/MenuPrincipal';
import RegistrarPersonal from './Pantallas/RegistrarPersonal';
import Olvidar from './Pantallas/OlvidarContraseña';
import Menu from './Pantallas/MenuPersona';
import EliminarPersona from './Pantallas/PersonaEliminar';
import EditarEstudiante from './Pantallas/EditarEstudiante';
import Estudiante from './Pantallas/Estudiante';
import Notificar from './Pantallas/Notificar';
import PersonaBuscarEditar from './Pantallas/PersonaBuscarEditar';

import MenuPlanTrabajo  from './Pantallas/MenuPlanTrabajo';
import PlanTrabajo  from './Pantallas/PlanTrabajo';
import RegisEditEquipo  from './Pantallas/RegisEditEquipo';
import BuscarEquipoTrabajo from './Pantallas/BuscarEquipoTrabajo';
import MenuEquipoTrabajo from './Pantallas/menuEquipoTrabajo';
import ActividadVM from './Pantallas/ActividadVM';
import ConsulElimiPlanTrabajo from './Pantallas/ConsulElimiPlanTrabajo';
import EditarPlanTrabajo from './Pantallas/EditarPlanTrabajo';


export default function RoutesP() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<Login/>}/>
                <Route path="/MenuPrincipal" element={<MenuP />} />
                <Route path="/RegistrarPersonal" element={<RegistrarPersonal />} />
                <Route path="/OlvidarContra" element={<Olvidar />} />
                <Route path="/MenuPersona" element={<Menu />} />
                <Route path="/PersonaEliminar" element={<EliminarPersona />} />
                <Route path="/EditaEstudiante" element={<EditarEstudiante />} />
                <Route path="/Estudiante" element={<Estudiante />} />
                <Route path="/Notificar" element={<Notificar />} />
                <Route path="/PersonaBuscarEditar" element={<PersonaBuscarEditar />} />

                <Route path="/MenuPlanTrabajo" element={<MenuPlanTrabajo />} />
                <Route path="/PlanTrabajo" element={<PlanTrabajo />} />
                <Route path="/RegisEditEquipo" element={<RegisEditEquipo />} />
                <Route path="/BuscarEquipoTrabajo" element={<BuscarEquipoTrabajo /> } />
                <Route path="/ActividadVM" element={<ActividadVM />} />
                <Route path="/MenuEquipoTrabajo" element={<MenuEquipoTrabajo />} />
                <Route path="/ConsulElimiPlanTrabajo" element={<ConsulElimiPlanTrabajo />} />
                <Route path="/EditarPlanTrabajo" element={<EditarPlanTrabajo />} />
            </Routes>
        </BrowserRouter>
    )
  }
